import React from "react";

export default ({ green, text, data }) => {
  return  <div className={green ? "green-list" : "red-list"}>
      <h5 className="heading no-margin">{text}</h5>
      <ul className="gray-background" style={{ margin: '0 0 10px 0', padding: 0 }}>
        <li id={green ? 'green-first-li': 'red-first-li'}>{data[0]}</li>
        {data.map((cookie, id) => {
          if (id === 0) return;
          return <li>{cookie}</li>;
        })}
      </ul>
    </div>

};
